import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import ActivitySelector from './components/ActivitySelector';
import UserHistory from './components/UserHistory';
import userPreferences from './utils/UserPreferences';
import './App.css';

function App() {
    const [data, setData] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [weatherData, setWeatherData] = useState(null);
    const [locationError, setLocationError] = useState(null);
    const [activities, setActivities] = useState([]);
    const [selectedActivities, setSelectedActivities] = useState([]);
    const [currentLocation, setCurrentLocation] = useState(null);
    const [userPrefs, setUserPrefs] = useState({});

    // Fetch test data from backend
    useEffect(() => {
        axios.get('http://127.0.0.1:8000/api/test/')
            .then(response => {
                setData(response.data);
                setLoading(false);
            })
            .catch(error => {
                setError(error);
                setLoading(false);
            });
    }, []);

    // Fetch activity suggestion
    const fetchActivitySuggestion = async (latitude, longitude) => {
        try {
            const response = await axios.post(
                'http://127.0.0.1:8000/api/activity-suggestion/',
                { 
                    latitude, 
                    longitude, 
                    max_activities: 5
                },
                { headers: { 'Content-Type': 'application/json' } }
            );

            const activitiesData = response.data.activities;
            console.log('Activities received:', activitiesData);

            setActivities(activitiesData);
        } catch (error) {
            console.error("Failed to fetch activities:", error);
            setLocationError('Failed to fetch activities');
        }
    };

    // Fetch user location, weather, and activity suggestion
    useEffect(() => {
        const fetchUserLocation = () => {
            if (navigator.geolocation) {
                navigator.geolocation.getCurrentPosition(
                    async (position) => {
                        const { latitude, longitude } = position.coords;
                        try {
                            const weatherResponse = await axios.post(
                                'http://127.0.0.1:8000/api/suggestions/', 
                                { latitude, longitude },
                                { headers: { 'Content-Type': 'application/x-www-form-urlencoded' } }
                            );
                            setWeatherData(weatherResponse.data);

                            await fetchActivitySuggestion(latitude, longitude);
                        } catch (err) {
                            setLocationError('Failed to get weather data');
                            console.error("API error:", err);
                        }
                    },
                    (error) => {
                        setLocationError('Location access denied');
                        console.error("Geolocation error:", error);
                    }
                );
            } else {
                setLocationError('Geolocation not supported');
            }
        };

        fetchUserLocation();
    }, []);

    if (loading) return <div>Loading...</div>;
    if (error) return <div>Error: {error.message}</div>;

    return (
        <BrowserRouter>
            <div>
                <header>
                    <nav>
                        <h1>Navix - Activity Suggestions</h1>
                    </nav>
                </header>

                <Routes>
                    <Route path="/" element={
                        <div style={{ padding: '20px' }}>
                            <h1>Welcome to Navix</h1>
                            <p>Backend Response: {data?.message}</p>

                            {locationError ? (
                                <div style={{ color: 'red', marginTop: '20px' }}>
                                    <h2>Error</h2>
                                    <p>{locationError}</p>
                                </div>
                            ) : weatherData ? (
                                <div style={{ marginTop: '20px' }}>
                                    <h2>Weather Information</h2>
                                    <div style={{ background: '#f0f0f0', padding: '10px', borderRadius: '5px' }}>
                                        <p><strong>Location:</strong> {weatherData.name}</p>
                                        <p><strong>Temperature:</strong> {weatherData.main?.temp}°C</p>
                                        <p><strong>Weather:</strong> {weatherData.weather?.[0]?.description}</p>
                                    </div>

                                    {activities && activities.length > 0 && (
                                        <div style={{ marginTop: '20px' }}>
                                            <h2>Suggested Activities</h2>
                                            <div style={{ display: 'grid', gap: '15px' }}>
                                                {activities.map((activity, index) => (
                                                    <div key={index} style={{ 
                                                        border: '1px solid #ddd', 
                                                        padding: '15px', 
                                                        borderRadius: '8px',
                                                        background: 'white'
                                                    }}>
                                                        <h3 style={{ 
                                                            textTransform: 'capitalize',
                                                            color: '#333',
                                                            marginBottom: '10px'
                                                        }}>
                                                            {activity.activity_name}
                                                        </h3>
                                                        <p style={{ color: '#666', marginBottom: '10px' }}>
                                                            {activity.place_count} places found
                                                        </p>

                                                        {activity.places && activity.places.length > 0 && (
                                                            <div>
                                                                <h4>Top Places:</h4>
                                                                <ul style={{ paddingLeft: '20px' }}>
                                                                    {activity.places.slice(0, 3).map((place, placeIndex) => (
                                                                        <li key={placeIndex} style={{ marginBottom: '5px' }}>
                                                                            <strong>{place.name}</strong>
                                                                            {place.rating && ` - ⭐ ${place.rating}`}
                                                                            {place.vicinity && (
                                                                                <div style={{ fontSize: '0.9em', color: '#888' }}>
                                                                                    {place.vicinity}
                                                                                </div>
                                                                            )}
                                                                        </li>
                                                                    ))}
                                                                </ul>
                                                            </div>
                                                        )}
                                                    </div>
                                                ))}
                                            </div>
                                        </div>
                                    )}
                                </div>
                            ) : (
                                <div style={{ marginTop: '20px' }}>
                                    <p>Loading weather data and activity suggestions...</p>
                                </div>
                            )}
                        </div>
                    } />
                </Routes>
            </div>
        </BrowserRouter>
    );
}

export default App;
